import React from 'react'
import '../css/joinCommunity.css'

function JoinCommunity() {
  return (
    <>
        <div>You're not part of a community!</div>
        <button>Join Now</button>
        <button>Create your own</button>
    </>
  )
}

export default JoinCommunity
